  false,\n\t\"url\": null,\n\t\"notes\": \"The Tulare Basin Protection Plan has been
  initiated by The Nature  Conservancy to elucidate the problems and opportunities
  of natural  diversity protection. Specifically, the objectives and methods of this
  \ study are: 1. To clearly define the former extent of biological diversity in the
  \ Tulare Basin. 2. To delineate the current preservation activities in the Basin.
  3. To update and expand element abstract and \"element\"* occurrence  information
  as part of the California Natural Diversity Data Base  (CNDDB). 4. To recognize
  element protection opportunities. 5. To propose element protection measures.\",\n\t\"owner_org\":
